script: |
  super -f text -I q12250.spq | sort > q12250.out

inputs:
  - name: q12250.spq
    data: |
      SELECT ALL CAST ( NULL AS INTEGER ) AS col1, - 37 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT - col0 NOT IN ( 85 - + - ( - col1 ), col2 * - col1 + + + col0, col0 );
  - name: tab0

outputs:
  - name: q12250.out
    data: |
